        console.log(' Tooltips cargados:', Object.keys(tooltipsData).length);
    } catch(e) {
        console.error(' Error tooltipsData:', e);
        tooltipsData = {};
    }
    
    window.onload = function() {
        try {
            allNodes = nodes.get(); 
            allEdges = edges.get();
            filtrar();
            setupTooltips();
        } catch(e) { console.error('Init error:', e); }
    };
    
    function setupTooltips() {
        if (!document.getElementById('customTooltip')) {
            var tooltipDiv = document.createElement('div');
            tooltipDiv.id = 'customTooltip';
            document.body.appendChild(tooltipDiv);
        }
        
        var currentElementId = null; 
        
        // HOVER NODO
        network.on('hoverNode', function(params) {
            currentElementId = params.node;
            showTooltip(params.node);
        });
        network.on('blurNode', function(params) {
            currentElementId = null;
            hideTooltip();
        });
        
        // HOVER ARISTA
        network.on('hoverEdge', function(params) {
            if (!currentElementId) {
                currentElementId = params.edge;
                showTooltip(params.edge);
            }
        });
        network.on('blurEdge', function(params) {
            if (currentElementId === params.edge) {
                currentElementId = null;
                hideTooltip();
            }
        });
        
        var container = document.getElementById('mynetwork');
        if (container) {
            container.addEventListener('mousemove', function(e) {
                if (currentElementId) updateTooltipPosition(e);
            });
            container.addEventListener('mouseleave', function() {
                currentElementId = null;
                hideTooltip();
            });
        }
    }
    
    function showTooltip(elementId) {
        clearTimeout(tooltipTimeout);
        var data = tooltipsData[elementId];
        if (!data) return; 
        
        try {
            var tooltip = document.getElementById('customTooltip');
            var statsHTML = '';
            for (var key in data.stats) {
                statsHTML += '<div class="tooltip-row"><span class="tooltip-label">' + key + ':</span><span class="tooltip-value">' + data.stats[key] + '</span></div>';
            }
            var htmlContent = '<div class="tooltip-header" style="background:' + data.color + '">' + data.tipo + '</div>' + 
                              '<div class="tooltip-body"><div class="tooltip-title">' + data.titulo + '</div>' + 
                              '<div class="tooltip-subtitle">' + data.subtitulo + '</div>' + statsHTML + '</div>';
            
            tooltip.innerHTML = htmlContent;
            tooltipTimeout = setTimeout(function() {
                tooltip.classList.add('show');
            }, 50);
        } catch(e) { console.error('Tooltip render error:', e); }
    }
    
    function updateTooltipPosition(event) {
        var tooltip = document.getElementById('customTooltip');
        if (tooltip && tooltip.classList.contains('show')) {
            var x = event.clientX;
            var y = event.clientY;
            var maxX = window.innerWidth - 380 - 20;
            var maxY = window.innerHeight - tooltip.offsetHeight - 20;
            x = Math.min(x + 15, maxX);
            y = Math.min(y + 15, maxY);
            tooltip.style.left = x + 'px';
            tooltip.style.top = y + 'px';
        }
    }
    
    function hideTooltip() {
        clearTimeout(tooltipTimeout);
        var tooltip = document.getElementById('customTooltip');
        if (tooltip) tooltip.classList.remove('show');
    }
    
    function updateDistricts() {
        var prov = document.getElementById('selProv').value;
        var distSel = document.getElementById('selDist');
        distSel.innerHTML = '<option value="">-- TODOS --</option>';
        if (prov && geoData[prov]) {
            geoData[prov].forEach(d => {
                var opt = document.createElement('option');
                opt.value = d; opt.innerHTML = d; distSel.appendChild(opt);
            });
        }
        filtrar();
    }

    function filtrar() {
        try {
            var txt = document.getElementById('inSearch').value.toUpperCase().trim();
            var perf = document.getElementById('selPerfil').value;
            var prov = document.getElementById('selProv').value;
            var dist = document.getElementById('selDist').value;
            
            var showColusion = document.getElementById('chkColusion').checked;
            var showFamiliaHermanos = document.getElementById('chkFamiliaHermanos').checked;
            var showFamiliaApellido = document.getElementById('chkFamiliaApellido').checked;
            var showTx = document.getElementById('chkTx').checked;
            
            var matchText = new Set();
            var matchGeo = new Set();
            var matchPerf = new Set();

            allNodes.forEach(n => {
                var term = n.search_term || "";
                if (txt && term.toUpperCase().includes(txt)) matchText.add(n.id);
                if (n.node_tipo === 'entidad') {
                    var passProv = !prov || n.node_provincia === prov;
                    var passDist = !dist || n.node_distrito === dist;
                    if (passProv && passDist) matchGeo.add(n.id);
                } 
                else if (n.node_tipo === 'proveedor') {
                    if (!perf || n.node_perfil === perf) matchPerf.add(n.id);
                }
            });
            
            var finalNodes = new Set();
            var finalEdges = new Set();
            matchText.forEach(id => finalNodes.add(id));

            allEdges.forEach(e => {
                if (e.edge_type === 'tx') {
                    var nFrom = allNodes.find(x => x.id === e.from);
                    var nTo = allNodes.find(x => x.id === e.to);
                    if (!nFrom || !nTo) return;
                    var ent = (nFrom.node_tipo === 'entidad') ? nFrom : nTo;
                    var prov = (nFrom.node_tipo === 'proveedor') ? nFrom : nTo;
                    if (matchGeo.has(ent.id) && matchPerf.has(prov.id)) {
                        if (showTx) finalEdges.add(e.id);
                        finalNodes.add(ent.id);
                        finalNodes.add(prov.id);
                    }
                }
            });
            
            allEdges.forEach(e => {
                if (e.edge_type !== 'tx') {
                    var active = (e.edge_type === 'familia_hermanos' && showFamiliaHermanos) || 
                                 (e.edge_type === 'familia_apellido' && showFamiliaApellido) ||
                                 (e.edge_type === 'colusion' && showColusion);
                    if (active) {
                        if (finalNodes.has(e.from) && finalNodes.has(e.to)) finalEdges.add(e.id);
                    }
                }
            });
            
            var nodeUpdates = [];
            var top5Candidates = [];
            allNodes.forEach(n => {
                var show = finalNodes.has(n.id);
                nodeUpdates.push({id: n.id, hidden: !show});
                if (show && n.node_tipo === 'proveedor') top5Candidates.push(n);
            });
            nodes.update(nodeUpdates);
            
            var edgeUpdates = [];
            allEdges.forEach(e => {
                var show = finalEdges.has(e.id);
                edgeUpdates.push({id: e.id, hidden: !show});
            });
            edges.update(edgeUpdates);
            actualizarTop5(top5Candidates);
            
        } catch(err) { console.error("Filter Error:", err); }
    }
    
    function actualizarTop5(candidatos) {
        candidatos.sort((a, b) => (a.node_score || 0) - (b.node_score || 0));
        var top5 = candidatos.slice(0, 5);
        var html = "";
        if (top5.length === 0) {
            html = "<div style='color:#666; font-style:italic; padding:5px; font-size:10px;'>Sin resultados...</div>";
        } else {
            top5.forEach((n, idx) => {
                var monto = parseFloat(n.node_monto || 0).toLocaleString('es-PE', { style: 'currency', currency: 'PEN' });
                var perfilCorto = n.node_perfil.split(' ')[0];
                var fullName = n.data_full_label || n.label;
                html += `<div class="top-item">
                            <div class="top-idx">#${idx + 1}</div>
                            <div class="top-info">
                                <div class="top-name" title="${fullName}">${fullName}</div>
                                <div class="top-meta">${perfilCorto} | IF: ${n.data_score}</div>
                                <div class="top-money">${monto}</div>
                            </div>
                         </div>`;
            });
        }
        document.getElementById('top5-list').innerHTML = html;
        document.getElementById('stats').innerText = candidatos.length + " nodos visibles";
    }
    
    function reset() {
        document.getElementById('inSearch').value = "";
        document.getElementById('selPerfil').value = "";
        document.getElementById('selProv').value = "";
        updateDistricts();
        document.getElementById('chkColusion').checked = true;
        document.getElementById('chkFamiliaHermanos').checked = true;
        document.getElementById('chkFamiliaApellido').checked = true;
        document.getElementById('chkTx').checked = true;
        filtrar();
        network.fit({animation:true});
    }
    document.getElementById('inSearch').addEventListener('keyup', function(e) { if (e.key === 'Enter') filtrar(); });
    </script>
